import {React,useState,useEffect} from "react";
import { getData } from "../services/dataService";
export default function ShowData()
{
    const [data,setData]=useState(null);
    useEffect(async()=>{
        debugger;
     const res =await getData();
     setData(res["bids"]);
     console.log(data);
    },[])
    return(
        <div>
            {data.map((coin)=> {
                <div>
            <div>{coin}</div>
            <div>{}</div>
            </div>
            }
             )}
        </div>
    )
}
